:root {

--text-font-family: 'Be Vietnam';
--text-font-is-google: 1;
--text-font-family-fallback: -apple-system, BlinkMacSystemFont, avenir next, avenir, helvetica neue, helvetica, Ubuntu, roboto, noto, segoe ui, arial;
--text-font-base: sans-serif;
--header-font-family: 'Be Vietnam';
--header-font-is-google: 1;
--header-font-family-fallback: Georgia, serif;
--code-font-family: 'Fira Mono';
--code-font-is-google: 1;
--base-font-size: 20px;
--text-font-size: 20px;
--code-font-size: 0.9rem;
--code-inline-font-size: 1em;
--header-h1-font-size: 45px;
--header-h2-font-size: 38px;
--header-h3-font-size: 30px;

--text-color: #272822;
--header-color: #912E33;
--background-color: #FFFFFF;
--link-color: #912E33;
--text-bold-color: #912E33;
--code-highlight-color: rgba(255,255,0,0.5);
--inverse-text-color: #FFFFFF;
--inverse-background-color: #912E33;
--inverse-header-color: #FFFFFF;
--inverse-link-color: #912E33;
--title-slide-background-color: #912E33;
--title-slide-text-color: #FFFFFF;
--header-background-color: #912E33;
--header-background-text-color: #FFFFFF;
--base: #912E33;
--white: #FFFFFF;
--black: #272822;
}
html {
font-size: var(--base-font-size);
}
body {
font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
font-weight: 300;
color: var(--text-color);
}
h1, h2, h3 {
font-family: var(--header-font-family), var(--header-font-family-fallback);
font-weight: 600;
color: var(--header-color);
}
.remark-slide-content {
background-color: var(--background-color);
font-size: 20px;
padding: 16px 64px 16px 64px;
width: 100%;
height: 100%;
}
.remark-slide-content h1 {
font-size: var(--header-h1-font-size);
}
.remark-slide-content h2 {
font-size: var(--header-h2-font-size);
}
.remark-slide-content h3 {
font-size: var(--header-h3-font-size);
}
.remark-code, .remark-inline-code {
font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
font-size: var(--code-font-size);
}
.remark-inline-code {
font-size: var(--code-inline-font-size);
color: #912E33;
}
.remark-slide-number {
color: #912E33;
opacity: 1;
font-size: 0.9rem;
}
strong {
font-weight: bold;
color: var(--text-bold-color);
}
a, a > code {
color: var(--link-color);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 60px;
padding-right: 4em;
font-size: 0.9em;
}
.remark-code-line-highlighted {
background-color: var(--code-highlight-color);
}
.inverse {
background-color: var(--inverse-background-color);
color: var(--inverse-text-color);
}
.inverse h1, .inverse h2, .inverse h3 {
color: var(--inverse-header-color);
}
.inverse a, .inverse a > code {
color: var(--inverse-link-color);
}
.title-slide, .title-slide h1, .title-slide h2, .title-slide h3 {
color: var(--title-slide-text-color);
}
.title-slide {
background-color: var(--title-slide-background-color);
}
.title-slide .remark-slide-number {
display: none;
}

.left-column {
width: 20%;
height: 92%;
float: left;
}
.left-column h2, .left-column h3 {
color: #912E3399;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #912E33;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px #912E3380;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th {
border-bottom: 1px solid #ddd;
}
th, td {
padding: 5px;
}
.remark-slide table:not(.table-unshaded) thead,
.remark-slide table:not(.table-unshaded) tfoot,
.remark-slide table:not(.table-unshaded) tr:nth-child(even) {
background: #E9D5D6;
}
table.dataTable tbody {
background-color: var(--background-color);
color: var(--text-color);
}
table.dataTable.display tbody tr.odd {
background-color: var(--background-color);
}
table.dataTable.display tbody tr.even {
background-color: #E9D5D6;
}
table.dataTable.hover tbody tr:hover, table.dataTable.display tbody tr:hover {
background-color: rgba(255, 255, 255, 0.5);
}
.dataTables_wrapper .dataTables_length, .dataTables_wrapper .dataTables_filter, .dataTables_wrapper .dataTables_info, .dataTables_wrapper .dataTables_processing, .dataTables_wrapper .dataTables_paginate {
color: var(--text-color);
}
.dataTables_wrapper .dataTables_paginate .paginate_button {
color: var(--text-color) !important;
}

.remark-slide-content.left pre,
.remark-slide-content.center pre,
.remark-slide-content.right pre {
text-align: start;
width: max-content;
max-width: 100%;
}
.remark-slide-content.left pre,
.remark-slide-content.right pre {
min-width: 50%;
min-width: min(40ch, 100%);
}
.remark-slide-content.center pre {
min-width: 66%;
min-width: min(50ch, 100%);
}
.remark-slide-content.left pre {
margin-left: unset;
margin-right: auto;
}
.remark-slide-content.center pre {
margin-left: auto;
margin-right: auto;
}
.remark-slide-content.right pre {
margin-left: auto;
margin-right: unset;
}

.remark-slide-content.header_background > h1 {
display: block;
position: absolute;
top: 0;
left: 0;
width: 100%;
background: var(--header-background-color);
color: var(--header-background-text-color);
padding: 2rem 64px 1.5rem 64px;
margin-top: 0;

## Solutions

--

- Fire up Excel!

--

- Use code to edit the values &quot;by hand&quot;. For instance, employing `dplyr::recode()`.

--

- Create an *ad hoc* solution using regular expressions.

--

- Use approximate string matching!


---

## Approximate string matching (I)

--

- The `stringdist` ([van der Loo, 2014](https://cran.r-project.org/web/packages/stringdist/index.html)) R package provides tools to calculate distances between strings

--

    + Intuitively, it makes sense that the &quot;Brasil&quot; string is very close to the &quot;Brazil&quot; string, and not-so-close to the &quot;Peru&quot; string.

--

- We can use this idea to help us with the join!

---

layout: true

## Approximate string matching (II)

---


```r
stringdist::stringdistmatrix(
  data_a$country, data_b2$country, method = &quot;osa&quot;, useNames = T
  )
```

```
##           Peru Chile Venezuela (Bolivarian Republic of) Brazil
## Brasil       6     5                                 30      1
## Chile        5     0                                 32      5
## Perú         1     5                                 32      6
## Venezuela    7     8                                 25      7
```

## `fuzzyjoin`

- The `fuzzyjoin` package ([Robinson et al., 2020](https://cran.r-project.org/web/packages/fuzzyjoin/index.html)) makes using approximate string matching in joins very straightforward:


```r
fuzzyjoin::stringdist_left_join(
  data_a, data_b2, by = &quot;country&quot;,
  method = &quot;osa&quot;, distance_col = &quot;dist&quot;,
  max_dist = 2 # this is the default threshold
)
```

```
##   country.x var_a country.y var_b2 dist
## 1    Brasil     a    Brazil      A    1
## 2     Chile     b     Chile      B    0
## 3      Perú     c      Peru      C    1
## 4 Venezuela     d      &lt;NA&gt;   &lt;NA&gt;   NA
```

--

- But what can we do about &quot;Venezuela&quot; here? **Human supervision** would help a lot!

---

## `inexact`

--

- `inexact` is an RStudio addin (GUI) to reproducibly supervise fuzzy joins.

--

- The package does not implement any algorithms (that is [`stringdist`](https://cran.r-project.org/web/packages/stringdist/index.html)&#39;s job), it only provides a graphical way to supervise them.

--

- It serves as a &quot;coding assistant&quot;, without ever modifying the R global environment by itself.

--

- `inexact` works within a programming environment (R), unlike other fuzzy join supervising tools (the [`reconcile-csv` OpenRefine extension](https://okfnlabs.org/reconcile-csv/); the [Fuzzy Lookup Excel add-in](https://www.microsoft.com/en-us/download/details.aspx?id=15011)).

## Code output (A)


```r
# You added custom matches:
inexact::inexact_join(
  x  = data_a,
  y  = data_b2,
  by = &#39;country&#39;,
  method = &#39;osa&#39;,
  mode = &#39;left&#39;,
  custom_match = c(
   &#39;Venezuela&#39; = &#39;Venezuela (Bolivarian Republic of)&#39;
  )
)
```

```
##     country var_a var_b2
## 1    Brasil     a      A
## 2     Chile     b      B
## 3      Perú     c      C
## 4 Venezuela     d      D
```

---

## Code output (B)





```r
# You added custom matches:
inexact::inexact_join(
  x  = data_a,
  y  = data_b2,
  by = &#39;country&#39;,
  method = &#39;osa&#39;,
  mode = &#39;left&#39;,
  custom_match = c(
   &#39;Venezuela&#39; = &#39;Venezuela (Bolivarian Republic of)&#39;
  ),
  match_cols = T
)
```

```
##     country var_a var_b2                             .match .dist
## 1    Brasil     a      A                             Brazil     1
## 2     Chile     b      B                              Chile     0
## 3      Perú     c      C                               Peru     1
## 4 Venezuela     d      D Venezuela (Bolivarian Republic of)    25
##   .custom_match
## 1         FALSE
## 2         FALSE
## 3         FALSE
## 4          TRUE
```

---

## Concluding remarks

--

- Graphical User Interfaces (GUIs) are convenient and time-saving. But they can also be **helpful in reproducible workflows**, when serving as **coding assistants**.

--

- An inspiration for this package was `questionr` ([Barnier, Briatte &amp; Larmar, 2020](https://juba.github.io/questionr/)), which offers a similar workflow for recoding values, reordering factors, etc. Go check it out!

--

- A long to-do list for `inexact`: more testing, better documentation, better interface, increased performances, new functions (e.g., join by more than one ID variable).

--

- Feedback is very welcome!
